If we want to create a new process from a running process we can use the system call fork(). This function creates a copy of the process that called it. int result = fork();
if (result == 0) { printf("Child process, pid: %d", getpid());
} else if (result > 0) { printf("Parent process, pid: %d, parent of %d", getpid(), result);
} WARNING : fork is non deterministic, whick means that sometimes it may run the parent process first but not always, it depends on the scheduler.

