If we want the parent process to wait for the child to finish we can use the system call wait(). This way our program becomes deterministic, it doesn't matter how many times we run it, we will always get the same output. int result = fork();
if (result == 0) { printf("Child process, pid: %d", getpid());
} else if (result > 0) { wait(NULL); printf("Parent process, pid: %d, parent of %d", getpid(), result);
}
